import React from 'react';
import { Link } from 'react-router-dom';

const ProgramsOffered = () => {
  return (
    <div className="programs-offered">
      <h2>Programs Offered</h2>
      <div className="program">
        {/* Use Link to create a clickable link to the Mentorship page */}
        <Link to="/mentorship">
          <img src="../../assets/mentorship.jpg" alt="Program 1" />
        </Link>
        <h3>Program 1</h3>
        <p>Description of Program 1.</p>
      </div>
      <div className="program">
        {/* Use Link to create a clickable link to the Interactions page */}
        <Link to="interactions">
          <img src="" alt="Program 2" />
        </Link>
        <h3>Program 2</h3>
        <p>Description of Program 2.</p>
      </div>
      {/* Add more programs with images as needed */}
    </div>
  );
}

export default ProgramsOffered;
